data.app_description:
Want to design and make a logo yourself? logo master is definitely your best choice.

Logo Master has tons of materials that you can use for free.
Including but not limited to:
~A lot of background image resources;
~A lot of graphic logo resources;
~ Lots of shape resources;

Logo Master has the following features:
~Change the color of the logo and freely scale the size;
~You can add multiple logos and set levels;
~You can change the background to a solid color or a picture;
~You can modify the shape of the logo;
~ You can add text and scale the size freely.
